import React from "react";
import { View, Text, StyleSheet, TouchableOpacity, ScrollView } from "react-native";
import logo from '../assets/logo.png'
import * as Animatable from 'react-native-animatable'
import { useNavigation } from '@react-navigation/native'

export default function Projetos() {
    const navigation = useNavigation();

    return (
        <View>
            <Animatable.View style={styles.header}>
                <Animatable.Image
                    animation={"flipInY"}
                    source={logo} style={styles.image} />
            </Animatable.View>

            <Animatable.View delay={400} animation={"fadeInUp"} style={styles.barHeader}>
                <Text>Home</Text>
                <Text>/</Text>
                <Text>Ferramentas</Text>
                <Text>/</Text>
                <Text>Projetos</Text>
                <Text>/</Text>
            </Animatable.View>

            <Animatable.View delay={400} animation={"fadeInUp"} style={styles.container}>
                <Text style={styles.headerText}>Projetos</Text>
                <TouchableOpacity
                    onPress={() => navigation.navigate('Login')}
                    style={styles.buttonExit}>
                    <Text style={styles.text2}>Sair</Text>
                </TouchableOpacity>
            </Animatable.View>
        </View>
    );
}

const styles = StyleSheet.create({
    header: {
        backgroundColor: "#fff",
    }, 
    barHeader: {
        backgroundColor: "#498DF3",
        flexDirection: 'row',
        justifyContent: 'space-evenly',
    },
    headerText: {
        margin: '5%',
        fontSize: 20,
        fontWeight: 'bold',
    },
    container: {
        alignItems: "center",
        justifyContent: "space-between",
        flexDirection: 'row'
    },
    image: {
        margin: 8,
        alignSelf: 'center'
    },
    text1 : {
        fontSize: 20,
    },
    text2: {
        fontSize: 20,
    },
    buttonExit: {
        backgroundColor: '#498DF3',
        width: 50,
        alignItems: "center",
        fontSize: 20,
        textAlign: "center",
        borderRadius: 6,
    },
});
